INSERT INTO `announcement` VALUES (1,'12/31 기준으로 탁구력 순위 1~3등, 경험치 순위 1~3등에게 상품을 지급합니다!\n자세한 내용은 아래 링크를 확인해주세요!','hyunkyle','2023-03-10 20:07:27','hyunkyle','2023-03-10 20:07:27','2023-03-10 20:07:27'),(2,'42GG배 탁구대회를 위한 설문조사를 진행중입니다!\n많은 참여 부탁드려요!!','hyunkyle','2023-03-10 20:07:27','hyunkyle','2023-03-10 20:07:27','2023-03-10 20:07:27'),(3,'42GG 서비스 시간에 대한 설문조사를 진행중입니다!\n많은 참여 부탁드려요!!','hyunkyle','2023-03-10 20:07:27','hyunkyle','2023-03-10 20:07:27','2023-03-10 20:07:27'),(4,'2022년 42GG 시즌 1이 종료되었습니다!!\n🏓탁구력 랭킹\n1위 : tyi(1322)\n2위 : nheo(1211)\n3위 : jeongkpa(1126)\n🏓경험치 랭킹\n1위: tyi(lv.19, 경험치 6290)\n2위: kiyolee(lv.18, 경험치 5330)\n3위: insjang(lv.13, 경험치 3080)','hyunkyle','2023-03-10 20:07:27','hyunkyle','2023-03-10 20:07:27','2023-03-10 20:07:27'),(5,'1/25~1/26 이틀동안 42GG배 탁구대회가 열립니다!!\n아래 링크를 통해 신청해주세요!','hyunkyle','2023-03-10 20:07:27','hyunkyle','2023-03-10 20:07:27','2023-03-10 20:07:27'),(6,'42GG 서비스를 사용할 수 있는 시간이 기존 14시~17시에서 24시간 사용 가능하도록 변경되었습니다!!\n많은 이용 부탁드려요!','hyunkyle','2023-03-10 20:07:27','hyunkyle','2023-03-10 20:07:27','2023-03-10 20:07:27'),(7,'시즌 2가 1/26 ~ (9기 입학날)까지 진행됩니다!\n다들 재미있게 즐겨주세요!','hyunkyle','2023-03-10 20:07:27','hyunkyle','2023-03-10 20:07:27','2023-03-10 20:07:27'),(9,'<p>🏓 <strong>42GG 업데이트 </strong>🏓</p><p><strong>&lt;42GG 슬롯 오류 수정&gt;</strong></p><p>00:00~00:15 슬롯이 등록이 활성화되었습니다. 해당 시간에도 탁구를 즐겨주세요. </p><p><strong>&lt;시즌 3 시작!&gt;</strong></p><p>3/13일 월요일 9기가 들어옴에 따라 새로운 시즌이 시작됩니다!</p><p><strong>&lt;게임 결과 수정 불가&gt;</strong></p><p>현재 42gg 운영시스템 상 전적 수정은 불가합니다. 이 점에 주의해서 게임 결과를 등록해주세요!</p>','yuikim','2023-03-10 20:25:21','yuikim','2023-03-10 21:27:25','2023-03-10 21:27:25'),(10,'<p class=\"ql-align-center\">🏓 <strong>42GG 업데이트 </strong>🏓</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-align-center\"><strong>&lt;게임 결과 수정 불가&gt;</strong></p><p>현재 42gg 운영시스템 상 전적 수정은 불가합니다. 이 점에 주의해서 게임 결과를 등록해주세요!</p><p><br></p><p class=\"ql-align-center\"><strong>&lt;42GG 슬롯 오류 수정&gt;</strong></p><p>00:00~00:15 슬롯 등록이 활성화되었습니다. 해당 시간에도 탁구를 즐겨주세요.</p><p><