INSERT INTO `feedback` VALUES (1,'2022-07-13 10:33:23','2023-03-12 20:33:18','🏓',_binary '',4,'ETC'),(2,'2022-07-13 11:47:58','2022-07-13 12:17:00','첫 응원!! 모든게 잘 될 겁니다!!',_binary '',7,'CHEERS'),(3,'2022-07-13 11:48:14','2022-07-13 12:17:02','화이팅!!!!!',_binary '',7,'CHEERS'),(4,'2022-07-13 12:05:52','2022-07-13 12:17:05','화이팅 너무 멋져 반할것 같아!',_binary '',27,'CHEERS'),(5,'2022-07-13 12:50:53','2022-07-13 13:23:42','42gg 프론트팀 짱! 백엔드 팀 짱! hakim은 우~~',_binary '',25,'CHEERS'),(6,'2022-07-13 14:06:23','2022-07-13 14:28:01','5분전 취소불가 버튼은 회색같은 무채색으로 해주셔도 좋을 것 같아요!!',_binary '',26,'OPINION'),(7,'2022-07-13 14:49:53','2022-07-18 11:26:43','라켓 종류 상관없음 선택할 수 있게 하는거 어떨까요 응원',_binary '',85,'CHEERS'),(8,'2022-07-13 16:25:43','2022-11-15 14:39:30','안녕하세요 doyun입니다~\n예약시간이 넘어서 안오거나 혹여 지각하는 경우 어떤식으로 처리해야할지 고민이 되실것 같아요.\n만약 지각자가 있다면 패널티로 3분 당 한 세트 점수를 주거나, 조금이라도 늦는다면 몰수패를 하거나...\n주어진 시간이 10분이고 최대 3판을 할 수 있으니 적절한 규칙을 정해주시면 좋을 것 같아요.\np.s. Daekim 멋쟁이',_binary '',114,'OPINION'),(9,'2022-07-15 00:14:36','2022-11-16 15:21:39','칭호 만들어주세여 부드러운 화면전환도 그리구 신고 말고 보내기 라고바꺼주세요',_binary '',197,'OPINION'),(10,'2022-07-21 09:58:49','2022-07-25 17:34:14','피드백 확인들 하고 계신가요??!! 42gg 화이팅',_binary '',3,'CHEERS'),(11,'2022-07-21 18:43:51','2022-11-15 14:39:34','42gg 덕분에 플랫폼의 힘을 직접 느끼고 있는 거 같습니다. 탁구 치시는 분들께 여쭤봐도 몇 개월 전에 비해 탁구 활성화 인구가 폭증했다고 하시네요. 물론 7기 유입 영향도 있겠지만 기존의 숨어계시던 강자들이 42gg 덕분에 서로를 알게 되어 보다 훨씬 더 탁구를 즐기게 된 거 같습니다. 좋은 플랫폼 만들어주셔서 감사합니다.',_binary '',84,'CHEERS'),(12,'2022-07-21 18:46:52','2022-11-16 15:21:44','1. slack에 알람을 보낼 수 있으면 좋을 거 같습니다. 42 유저들이 계속 확인하는 플랫폼은 슬랙입니다. 해서, 주말 같이 매칭이 잘 되지 않을 때는 42gg에 탁구를 치고 싶은 상대가 있음을 알리고 싶어합니다. 그런 점에서 시간 대에 매칭을 한 후 \"슬랙에 알리시겠습니까\"라는 버튼에 \"예\"를 누르면 slack에 \"00:00분 매칭이 시작되었습니다\"라고 뜨면 좋을 거 같습니다. 물론 지금 더 활성화 되어있지만, 이런 슬랙 알림으로 기존 유저의 플랫폼 사용 빈도를 높일 수 있으리라 생각합니다.',_binary '',84,'OPINION'),(13,'2022-07-21 18:51:59','2022-11-16 15:21:46','2. 이건 유저 확장을 위한 홍보 아이디어이기도 하고 42gg 사용자 경험의 개선을 위한 아이디어이기도 합니다. 매칭하고, 스코어를 적어 게임을 마무리 한 후에 뽑기 혹은 로또 같은 게임적 요소를 집어넣는 겁니다. 가지고 있는 자원에 따라, 보상을 정하고, 이를 슬랙에 홍보해서 게임을 끝낼 때마다 당첨 여부를 확인할 수 있게 하면, 아마 많은 홍보효과가 있을 것으로 보입니다. 또한, 42gg 메인 페이지에 한 마디 남길 수 있게 하는 정도의 보상만을 정해도 사용자는 게임적 경험을 할 수 있을 것으로 보입니다. ',_binary '',84,'OPINION'),(14,'2022-07-21 18:56:03','2022-11-16 15:21:47','3. 메인 페이지에서 조금 더 경쟁심을 불태울 수 있으면 좋겠습니다. 1-3까지가 아니라, 1-5까지 나오고 이들의 닉네임에 특수 효과를 주거나 다이아 마스터 같은 칭오를 붙여주면 순위 쟁탈의 게임성이 더 올라갈 거 같습니다. 또한, \"악당\" \"신흥강자\" 처럼 승리하고 있는 사람들을 메인 페이지에 띄어줌으로써 현재 랭킹에 들지 않는 사람일지라도, 성취감을 주어 게임 활성화 정도를 더 높일 것이라 생각합니다. ',_binary '',84,'OPINION'),(15,'2022-07-21 19:00:13','2022-11-16 15:21:48','4. 승리 스코어를 적는 결과 창에 \"학습\" 버튼을 넣으면 좋겠습니다. 탁구 또한 분명히 동료 성장 해야 합니다. 근데, 오로지 승부에만 초점이 맞추어져 있다 보니 경쟁의 요소만 보일 뿐, 상호 학습은 하기 어렵습니다. 이 게임을 학습 게임으로 끝낼 수 있다면 10분이란 짧은 시간을 서로가 학습하면서 배울 수 있을 겁니다. 초기 매칭 버튼에 학습 버튼을 눌러 경쟁을 피하는 방식도 있을 거고요. 그리고, 이 학습 포인트를 쌓아서 상품을 주는 방식도 있을 거고요. 42gg를 통해서 동료 학습의 경험을 만들어낼 수 있습니다.홍보도 필요할',_binary '',84,'OPINION'),(16,'2022-07-21 19:03:16','2022-11-16 15:21:50','42gg 아니었으면 탁구하는 분들과 이렇게 빠르게 친해지기 어려웠을 거 같습니다. 다시 한 번 42gg 개발진 분들에게 감사를 표합니다. 감사합니다. ',_binary '',84,'CHEERS'),(17,'2022-07-22 11:41:50','2022-11-16 15:21:51','1.2시부터 5시까지 램크 뿐만아니라 일반게임 추가 시, 인원제한 상관없이 플레이할 수 있도록 한명이 시간 예약하면 그 시간대는 예약 완료된 것으로 해야할 것 같습니다. (4명이서 플레이 하고싶은데 4명다 예약 누르러 가기엔 불편하니까) 혹시 일반하고 싶은데 같이 칠 사람이 없을 수 있으니 위에서 얘기한 방식 말고 기존 랭크 생성하는 방식으로 일반을 생성할 수 있어야 할것도 같습니다.\n',_binary '',114,'OPINION'),(18,'2022-07-22 11:44:25','2022-11-16 15:21:53','2. 탁구대가 비는 시간이 많은 것 같습니다.\n만약 일반으로 시간을 오픈한다면 20~30분정도가 좀 게임을 즐길 수 있지 않나 싶습니다.(4명이서 10분은 좀 부족할 것 같아서)\n뒤에 사람 없으면 자동으로 시간 연장되는방식도 생각해보았는데, 게임하다가 뒤에 예약되었는지 확인해봐야 할 것 같아 처음부터 시간을 넉넉하게 정할 수 있도록 하는 것도 좋을 것 같습니다.\n\nGG팀 화이팅!!!!!!!!!',_binary '',114,'OPINION'),(19,'2022-07-22 16:36:43','2022-11-16 15:22:00','건의 사항이 몇가지 있습니다.\n1. 탁구대 시간을 예약하는게 조금 불편한 것 같습니다. 원하는 시간에 칠 수 있다는 장점이지만 한편으로 다소 번거롭기도 합니다. 개인적으로 예약시간제를 없애고 랭크게임 요소만 남겼으면 좋겠습니다.\n\n2. 리그제처럼 1부 2부 3부.. 등으로 부수를 나누고 티어 차이가 나는 부수끼리 게임을 하면 적당한 핸디를 부여해서(점수 잡아주기) 티어차이가 나더라도 게임을 할 수 있게 해주시면 좋겠습니다.\n\n끝으로 재밌는 사이트 개발해주셔서 감사합니다!',_binary '',164,'OPINION'),(20,'2022-07-23 14:20:56','2022-07-30 16:24:27','오늘 minseok2님과 경기 2ㄷ1로 이겼는데 2ㄷ0으 승리로 기입해버렸습니다 ㅠ 정정해주시면 감사하겠습니다',_binary '',164,'GAMERESULT'),(21,'2022-07-23 18:16:42','2022-11-16 15:22:01','피드백 확인하고 있습니다. 42gg 확이팅!',_binary '',2,'CHEERS'),(22,'2022-07-24 16:48:11','2022-07-30 16:24:35','죄송합니다.. hseong님과의 두번째 경기 2ㄷ0 승리가 아니라 2ㄷ1 승리입니다 ㅜㅜ',_binary '',164,'GAMERESULT'),(23,'2022-07-26 16:10:09','2022-07-30 16:24:40','jahwkim이 2로 승리하였는데 점수를 잘못 기입하였습니다 정정 부탁드립니다ㅜㅜㅜ',_binary '',235,'GAMERESULT'),(24,'2022-08-01 13:46:41','2022-11-16 15:22:03','9승 2패인데 계속 3패로 나옵니다 이것덕분에 밤에 잠이 잘 오지 않습니다 도와주세요 ㅠㅠ',_binary '',25,'BUG'),(25,'2022-08-02 14:40:38','2022-11-16 15:22:05','그리고 게임적 요소를 넣을 때 파칭코의 원리를 적용하시면 도움이 될 거 같습니다. 단순한 확률 게임임에도, 레버를 사용자가 직접 내리게 해서, 결과를 통제하는 듯한 느낌을 들게 했습니다. 그리고, 그 과정에서 성공과 실패가 번갈아가며 나오면서, 기대하지 못한 순간에 반복적으로 희망을 주었고요. 결국 꽝이 나온다할지라도 사용자는 확률을 인식하는 게 아니라, 자신의 손을 탓합니다. 점수 인식 후 레버를 누르는 페이지를 만든다면? 그리고 룰렛이 돌아가며, 성공과 실패가 번갈아나온다면? 점수 입력을 갈망할 겁니다. 보상은 닉넴 변경등다양합',_binary '',84,'OPINION'),(26,'2022-09-11 15:59:29','2022-11-16 15:22:07','화이팅..!',_binary '',5,'CHEERS'),(27,'2022-09-23 17:50:58','2022-11-16 15:22:08','hi',_binary '',3,'CHEERS'),(28,'2022-11-02 11:45:55','2022-11-16 15:22:09','42gg 최고! 다들 화이팅~!!!',_binary '',7,'CHEERS'),(29,'2022-11-15 14:34:47','2022-11-15 14:40:24','너무 잘 만들었어요!!!!!!! 최고 천재들!!!!!',_binary '',6,'CHEERS'),(30,'2022-11-15 15:44:06','2023-01-01 22:21:11','42gg 화이팅입니다. 요즘 덕분에 탁구 재미있게 치고 있어요! ㅎㅎ',_binary '',338,'CHEERS'),(31,'2022-12-10 15:51:42','2022-12-27 16:44:01','관리자님, 안녕하세요. 점수 입력을 반대로 하여 승패가 반대가 되었습니다. 바로잡을 수 있을까요?',_binary '',402,'ETC'),(32,'2022-12-23 17:35:18','2022-12-27 16:44:03','운영진 여러분 안녕하세요^^\n여러분 덕분에 요즘 슬기로운탁구생활을 하고 있어 감사하다는 말씀 전합니다.\n문의/의견이 하나 있습니다.\n최근 42서울 인트라넷 slack관련 api를 통해 각종 이메일 알림을 slack으로 받을 수 있게 되어 삶의 질이 몹시 좋아졌습니다. 현재 42gg도 각종 알림이 이메일로 전해지고 있는데요, 혹시 42gg도 매칭 알림을 slack으로 받을 수 있을까요? 가능하다면 방법을 알려주시면 감사하겠습니다. 아직 가능하지 않다면 가능하게 해주시면 좋겠다는 의견을 전합니다. 감사합니다^^ ',_binary '',402,'ETC'),(33,'2023-01-30 21:59:41','2023-01-30 21:59:41','안녕하세요 42gg님들!! 밤에도 서비스 이용할 수 있게되어서 재밌게 잘 이용하고 있습니다. 그런데 하나 불편한 것이 있어서요.. 이전에 저는 같이치는 3명~5명동료들과 쉴겸 올라가서 복식도 치고 밀어내기도 하고 그랬었는데 지금은 15분 선착순 2명씩 예약만 가능해한지라.. 이전처럼 다수, 홀수동료들과 함께 쉬고 즐기기가 어려워졌네요 흑흑. 4인 30분, 5인 40분 이렇게 빌려놓고 시간안에서 자유롭게 칠 수는 없을까해서 건의드려보아요!',_binary '\0',79,'OPINION'),(34,'2023-01-31 22:59:09','2023-02-01 13:25:47','42gg 파이팅!',_binary '',437,'CHEERS'),(35,'2023-02-11 20:03:55','2023-02-11 20:03:55','저는 랭크나 일반이나 상관 없이 아무하고나 빠르게 치고 싶은데 둘 중 하나를 골라야 해서 비효율적이라는 생각이 듭니다. \"종목자유\" 유형을 만들어서 방을 고르는 사람이 현재 \"랭크\"에서 고르는지 \"일반\"에서 고르는지에 따라 매칭 타입을 정해주는 모드를 만들어주셨으면 합니다.',_binary '\0',353,'OPINION'),(36,'2023-02-12 14:07:02','2023-03-14 15:29:47','2기 화이팅!',_binary '',406,'CHEERS'),(37,'2023-02-19 14:53:33','2023-02-19 14:53:33','메일로 42gg관련 사항이 오는 부분을 슬랙으로 오게 한다던가 끄는 기능이 있었으면 좋겠습니다.',_binary '\0',353,'OPINION'),(38,'2023-02-25 17:57:31','2023-02-25 17:57:31','죄송합니다 또 스코어 오기입했습니다.^^;;\n오늘 2월 25일 5시 45분 경기 결과를 다음과 같이 정정해주시면 감사하겠습니다.\nkiyolee 2 : 1 tyi',_binary '\0',402,'ETC'),(39,'2023-03-06 15:40:50','2023-03-06 15:40:50','한 번에 신청할 수 있는 슬롯을 2개(30분) 이상으로 늘려주셨으면 합니다. 15분이 너무 짧은 느낌이 들어요... ',_binary '\0',348,'OPINION'),(40,'2023-03-10 21:15:45','2023-03-11 11:09:16','2기 배포 파이팅!',_binary '',437,'CHEERS'),(41,'2023-03-29 19:15:39','2023-04-10 20:27:12','콘솔게임 매칭 시스템이 있으면 좋겠다고 생각이 들어서 만들어 보고 싶다는 생각이 들었는데 42gg 서비스에 추가하면 좋겠다라는 생각이 들었습니다. 추후에 만드실 생각이 있으신지 궁금합니다 !!',_binary '',579,'ETC'),(42,'2023-04-25 19:38:40','2023-04-25 19:38:40','남여 복식 대회 만들면 재밌을 것 같아요!',_binary '\0',404,'OPINION');
